import React from 'react';
import AppBar from '@mui/material/AppBar';
import { Tab, Tabs, Toolbar, Typography } from '@mui/material';
import { img } from '@mui/system';
import './navBar.css';
import renoldLogo from '../../Images/instalogo.png';

function NavBar(){
    return(
        <React.Fragment>
            <AppBar className='custom-app-bar' position='static' >
                <Toolbar className='app-toolbar'>
                    <img src={renoldLogo} className='reynold-logo' alt='logo' sx={{display:{xs:'none', md:'flex'}}}/>
                    <Typography variant='h5' sx={{marginLeft:'10px', display:{xs:'none', md:'flex'}}}>Renold Engineering</Typography>
                    <Tabs sx={{marginLeft:'auto'}} className='app-tabs'>
                        <Tab className='app-bar-tab' label='Home'/>
                        <Tab className='app-bar-tab' label='Products'/>
                        <Tab className='app-bar-tab' label='About'/>
                        <Tab className='app-bar-tab' label='Contact Us'/>
                    </Tabs>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    );
}

export default NavBar;
